eve inflama&ccedil;&atilde;o p&eacute;lvica, vulner&aacute;vel a infec&ccedil;&otilde;es urin&aacute;ria, hist&oacute;rico de dificuldade de alcan&ccedil;ar.</p>\r\n'),(245,275,'2023-07-14','91','175','135/81','80','0',NULL,'2023-07-14','','','','','','<p>O paciente queixa-se com diabetes e hipertensao, foi diagnosticado a 3 anos,dor no braco, tem notado a visao turva.</p>\r\n'),(246,278,'2023-07-14','53','157','102/73','89','0',NULL,'2023-07-14','','','','','','<p>A&nbsp; Dor de peito, cansaco, desmaios.&nbsp;</p>\r\n'),(247,280,'2023-07-16','60','164','96/72','73','0',NULL,'2023-07-16','','','','','','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CONSULTA DE GINECOLOGIA</p>\r\n\r\n<p>Dores de bexiga&nbsp;desde os 16 anos, em algumas vezes tem tido infec&ccedil;&otilde;es urin&aacute;ria, urina f&eacute;tida, comix&otilde;es na reigi&atilde;o genital, cheiro forte do muco servical, menstrua&ccedil;&atilde;o dupla, sentia dores no acto sexual, dificuldade na evacu&ccedil;&atilde;o, feses duras, empantorramento.</p>\r\n'),(248,281,'2023-07-17','70','0','0','0','0',NULL,'2023-07-17','','','','','','<p>A paciente queixa-se com HIV a 12 anos, 110 o CD4,&nbsp; tem tido infeccao urinaria.&nbsp;</p>\r\n'),(249,285,'2023-07-18','65','178','128/67','85','0',NULL,'2023-07-18','','','','','','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CONSULTA&nbsp; UROLOGIA/GERAL</p>\r\n\r\n<p>Paciente apresenta problemas de impotencia sexual com dificuldade de manter&nbsp;a ere&ccedi