nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CONSULTA DE FERTILIDADE</p>\r\n\r\n<p>Paciente apresenta, dificuldade de alcansar j&aacute; a 7 meses, usava anticoncepcionais, dores em forma de picadas, j&aacute; teve uma cirurgia do ap&eacute;dice.</p>\r\n'),(258,298,'2023-07-24','69','170','120/101','102','0',NULL,'2023-07-24','','','','','','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CONSULTA DE GASTRENTEROLOGIA</p>\r\n\r\n<p>Paciente est&aacute; com refluxo gasteroesof&aacute;gico, pris&atilde;o de ventre, hemorroidas, gases, arrotos, queima&ccedil;&atilde;o.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(259,299,'2023-07-24','84','183','132/77','68','0',NULL,'2023-07-24','','','','','','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CONSULTA GERAL</p>\r\n\r\n<p>Paciente apresenta dores de coluna, tonturas, picadas na reigi&atilde;o do f&iacute;gado, j&aacute; foi diagnosticado com Hepatite B.</p>\r\n'),(260,297,'2023-07-25','0','0','0','0','0',NULL,'2023-07-25','','','','','','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CONCUS&Atilde;O DIAGN&Oacute;STICA</p>\r\n\r\n<p>Paciente foi diagnosticada com dois miomas, intramural 8mm estando