INSERT INTO `justificativomedico` VALUES (1,41,'2023-03-02 07:03:29','                                                            A paciente esteve em consulta no dia 13 de março pelas 8 horas, foi atendida pelo Naturopata, com intuito de dar sequência ao tratamento.\r\n\r\nRecomendações:\r\nRepouso de 2 dias para cumprir com a medicação.\r\n                                                                                                                                                                        '),(2,41,'2023-03-13 03:03:36','<p>&nbsp; &nbsp; &nbsp; &nbsp; A paciente esteve em consulta no dia 13 de mar&ccedil;o pelas 8 horas, foi atendida pelo Naturopata, com intuito de dar sequ&ecirc;ncia ao tratamento.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Recomenda&ccedil;&otilde;es:<br />\r\nRepouso de 2 dias para cumprir com a medica&ccedil;&atilde;o.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n'),(3,150,'2023-05-03 05:05:34','                                                                                                                                                                                 \r\n\r\n   <p>      O Senhor Nguene Butucayandi foi consultado pelo Terapeuta Dias da Costa, no intervalo das 7 ás 14h do dia 03/05/2023.  </p>\r\n                                                                             \r\n\r\n             Por ser verdade passamos o presente justificativo.                                                                                          '),(4,172,'2023-05-11 03:05:50','                                                                                                                                                                                    <p>Dias Moises Costa Cassinda, Terapeuta em serviço neste consultório, declaro ter observado a Sr.(a) Joselma Sepisso no dia 10 de Maio de 2023, as 10h para uma consulta de controlo, e verificou-se a necessidade de dar um repouso médico de 7 dias, por causa das reações que a medicação tem causado na mesma.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n                         \r\n<p>                                                                                      Luanda, aos 10 de Maio de 2023</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n                                                                                                                                                                        '),(5,199,'2023-05-25 09:05:09','<p>Eu Dias Moises Costa Cassinda declaro ter recebido o paciente Vatileny Silas Benjamim Campos&nbsp; para uma consulta Gastrointestinal no dia 25,05,2023 as 10 horas pelo motivo de de diagnostico, Dor de estmago e&nbsp;vomitos.</p>\r\n\r\n<p>Deve Beneficiar de repouso de 2 dias apartir de referida data.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(6,198,'2023-05-25 09:05:54','                                                            Eu Dias Moises Costa Cassinda declaro ter recebido o paciente Vatileny Silas Benjamim Campos, acompanhada pela senhora Emilia G. Benjamim Campos para uma consulta Gastrointestinal no dia 25,05,2023 das 10 as 17 horas pelo motivo do diagnostico, Dor de estomago e vômitos.\r\n\r\n<p>Deve Beneficiar de repouso de 2 dias a partir de referida data\r\n                                                        '),(7,204,'2023-06-01 04:06:52','                                                                                                                        <p>Eu Dias Moises Costa Cassinda declaro ter recebido o paciente Joaquim Itela  para uma consulta Infecciologia no dia 31,05,2023 as 10 horas pelo motivo dos sintomas, Dor ao urinar, dor de estomago, fraqueza e dor de cabeça constante. </p>\r\n\r\n<p>Deve Beneficiar de repouso de 7 dias partir de referida data. </p>\r\n                                                                                                                '),(8,220,'2023-06-11 03:06:12','                                                                                                                        <p>Eu Dias Moises Costa Cassinda declaro ter recebido a paciente Josefa Martins Filipe  para uma consulta de Ginecologia no dia 09,06,2023 as 10 horas pelo motivo  de diagnostico, dores durante a mentruacao, coceira vaginal.</p>\r\n\r\n<p>Deve Beneficiar de repouso de 2 dias apartir da referida data.</p>\r\n                                                                                                                '),(9,99,'2023-06-14 09:06:25','                                                                                                                        <p>Eu Dias Moises Costa Cassinda declaro ter recebido o paciente Suzana Helena M. Joao   para uma consulta de Ginecologia no dia 5,06,2023 as 10 horas pelo motivo de de diagnostico, dor na região pélvica, infeção urinaria. </p>\r\n\r\n<p>Deve Beneficiar de repouso de 7 dias apartir de referida data.</p>\r\n                                                                                                                '),(10,99,'2023-06-15 06:06:43',''),(11,209,'2023-06-19 04:06:48','<p>Eu Dias Moises Costa Cassinda declaro ter recebido a paciente Iracema Maria Medon&ccedil;a&nbsp;&nbsp; para uma consulta Gastrointestinal no dia 14,06,2023 as 9&nbsp;horas pelo motivo de diagnostico, Dor de estomago, infeccao urinaria.</p>\r\n\r\n<p>Deve Beneficiar de repouso de 3&nbsp;dias apartir de referida data</p>\r\n'),(12,196,'2023-06-22 05:06:58','<p>Eu <strong>Miguel Domingos Canguia</strong>, M&eacute;dico Naturopata desta institui&ccedil;&atilde;o, declaro ter recebido a Senhora&nbsp;<strong>Jocelina Josefa Dias Pedro</strong>, para uma consulta geral&nbsp;no dia 24/05/2023 &agrave;s 14 horas, pelo motivo de diagn&oacute;stico de problemas de sa&uacute;de reprodutora, g&aacute;strica e outros.</p>\r\n\r\n<p>Deve beneficiar-se de repouso de <strong>9 dias</strong>, desde <strong>22/06/2023</strong> (quinta-feira) at&eacute; <strong>30/06/2023</strong> (sexta-feira).</p>\r\n'),(13,196,'2023-06-22 05:06:45','<p>Eu <strong>Miguel Domingos Canguia</strong>, M&eacute;dico Naturopata desta institui&ccedil;&atilde;o, declaro ter recebido a Senhora <strong>Jocelina Josefa Dias Pedro</strong>, para uma consulta geral no dia 24/05/2023 &agrave;s 14 horas, pelo motivo de diagn&oacute;stico de infec&ccedil;&atilde;o urin&aacute;ria, inflama&ccedil;&atilde;o p&eacute;lvica, febre tifoide, paludismo,&nbsp;e outros.</p>\r\n\r\n<p>Deve beneficiar-se de repouso de <strong>9 dias</strong>, desde 22/06/2023 (quinta-feira) at&eacute; <strong>30/06/2023</strong> (sexta-feira).</p>\r\n'),(14,269,'2023-07-11 07:07:56','<p>Eu <strong>Miguel Domingos Canguia</strong>, m&eacute;dico Naturopata,&nbsp;declaro ter recebido a paciente <strong>Esperan&ccedil;a Fernando</strong> para uma consulta de ginecologia no dia 11/07/2023, &agrave;s 11:45min, apresentando dores na reigi&atilde;o p&eacute;lvica,&nbsp;desconfortos genitais e&nbsp;gripe,&nbsp;&nbsp;sendo submetida a exames.</p>\r\n\r\n<p>Deve beneficiar-se de repouso neste mesmo dia <strong>11/07/2023.</strong></p>\r\n'),(15,269,'2023-07-11 07:07:30',''),(16,307,'2023-07-31 05:07:07','<p>Eu Miguel&nbsp;Canguia&nbsp;declaro ter recebido a&nbsp;paciente&nbsp; Sinara Cecilia M.Chipango. &nbsp;para uma consulta de Cl&iacute;nica Geral&nbsp;no dia 26,07,2023 as 9&nbsp;horas pelo motivo de dor de cabe&ccedil;a,febre e com um diagn&oacute;tico de paludismo . A mesma deve Beneficiar de repouso de 3&nbsp;dias apartir de referida data.</p>\r\n'),(17,246,'2023-08-10 07:08:07','<p>Eu <strong>Miguel Domingos Canguia</strong>, m&eacute;dico Naturopata desta institui&ccedil;&atilde;o de sa&uacute;de natural, declaro ter recebido a paciente <strong>Eug&ecirc;nia Alegria Milonga </strong>p