s&atilde;o de ventre, dores abdominais, tonturas, falta de apetite e com o tamanho grande da barriga, pelo motivo foi submetida a exames cl&iacute;nicos e de imagens, diagnosticando-se <strong>Ascite ou Barriga d&acute;agua.</strong></p>\r\n\r\n<p>Deve-se beneficiar na redu&ccedil;&atilde;o das suas actividades laborais, de no m&aacute;ximo tr&ecirc;s dias de trabalho semanal, a contar desde <strong>04/01/2024</strong> at&eacute; <strong>05/05/2024</strong>.</p>\r\n'),(28,642,'2024-01-15 12:01:17','                                                                                                                        <p>Yellyssaa Keren da Silva Bentes, paciente com antecedentes pessoais de saúde aparente, veio acompanhada de sua mãe no dia 28 de Setembro a qual apôs  avaliação médica foi diagnosticada com Malaria  vs alergia cutânea de grau leve.</p>\r\n\r\n<p>A paciente Foi subimetida a conduta terapeutica isto é de 29 Setembro à 28 de Outumbro de 2023.</p>\r\n                                                                                                                '),(29,641,'2024-01-15 12:01:00','                                                                                                                        <p>Otchaally Kesia da Silva Bentes, paciente com antecedentes pessoais de saúde aparente, veio acompanhada de sua mãe no dia 28 de Setembro a qual apôs avaliação médica foi diagnosticada com Malária acompanhada de disfunção hematológica e foi submetida a conduta terapêutica de 29 Setembro à 20 de Outubro de 2023.</p>\r\n                                                                                                                '),(31,722,'2024-01-25 10:01:34','                                                            <p>Dias Moises Cassinda Médico Naturopata em Serviço nesta instituição, declara ter observado no dia 25 de Janeiro de 2024, A senhora Maria Estrela Matondo,  processo nº 913 com o diagnostico amenorreia. </p>\r\n                   