re bem. \n','2024-06-21','2024-06-21 12:06:55',1,1),(1771,1059,'  CARDÁPIO PARA UM DIA DE LIMPEZA HEPÁTICA\n\n                                                       Pequeno-almoço (7:00h) Suco limonada antinflamatório\n\n1 xicara de suco de limão espremido, de 4 a 6 limões.\n3 xícaras de água.\n1 colher de chá de curcuma ou açafrão em pó.\n1 colher de chá de canela em pó.\nBater tudo no liquidificador e tomar.\n\n                                                              Segunda refeição (10:00h) Suco integral de uvas\n\n1 xícara e meia de uvas pretas ou vermelhas.\nBater tudo no liquidificador sem adicionar nada.\n\n                                                              Terceira refeição (13:00h) Suco limpador hepático\n\n1 xícara de repolho roxo.\n3 cenouras.\n1 maçã vermelha com casca.\n2 colheres de sopa do suco de limão.\nDepois de lavados, passar o repolho, as cenouras e a maçã a vapor ou uma pequena fervura e só depois adicionar o suco de limão e mexer.\n\n                                                                    Quarta refeição (16:00h) Infusão de hibisco.\n\nFerver 1 xícara de água aparte e adicionar 1 colher de chá das folhas de hibisco.\n\n                                                                       \n\n                                                                          Quinta refeição (19:00h) Água de chia\n\n4 colheres de sopa de semente de chia.\n6 colheres de sopa de suco de limão.\n4 xícara de água.\nColocar de molho as sementes de chia em um copo de água por 30min.\nColocar essa água com sementes no liquidificador e bater até se tornar uma pasta.\nAdicionar o restante da água e o suco de limão, mexendo até que se misture bem. \n','2024-06-21','2024-06-21 12:06:10',1,1),(1772,1059,'1- Chá composto de:\nPimenta africana.\nDondo.\nDez mandamentos.\nSemente cola.\nCanela.\nFerver em 6 litros de água, tomar 1 xícara 2 vezes ao dia, 6/18h.\n\n2- Composto antiviral (frasco de gota).\nAdicionar 9 gotas em meio copo de águ