ornar uma pasta.\nAdicionar o restante da água e o suco de limão, mexendo até que se misture bem. \n','2024-06-30','2024-06-30 13:06:47',1,1),(1831,931,'1- Chá composto de:\nCamomila.\nFolha de loro (15 folhas).\nAlface.\nFerver 4,5 litros de água a parte, adicionar as folhas na água quente, tomar 1 vez ao dia, 21h.\n\n2- Chá composto de:\nAlecrim.\nBoldo.\nHibisco.\nLosna.\nFerver 5 litros de água a parte, adicionar as folhas na água quente, tomar 2 vezes ao dia, 6/18.\n\n3- Suco puro de cebola.\nTomar 250ml para meia cebola, batendo no liquidificador, tomar 1 vez ao dia  antes das 18h.\n','2024-07-01','2024-07-01 09:07:03',1,1),(1832,837,'1- Vinagre de maçã.\nAdicionar 2 colheres de sopa em 1 copo de água natural, tomar 1 copo 2 vezes ao dia, antes das refeições.\n\n2- Chá de alecrim.\nTomar 1 xícara 2 vezes ao dia, 6:30/18:30min.\n\n3- Chá de hibisco.\nTomar 1 xícara 2 vezes ao dia, 7/19h.\n\n4- Chá de camomila.\nTomar 1 xícara 1 vezes ao dia, 21h.\n\n5- Suco visão em alta.\n3 cenouras médias.\n1 xícara das folhas de espinafre.\n1 colher de chá de gergelim.\n1 copo do suco puro de laranja.\nBater tudo no liquidificador, tomar 1 copo antes das 18h.\n\n','2024-07-01','2024-07-01 12:07:20',1,1),(1833,644,'1- Chá composto de:\nchjsapeui de couro\nalecrim\nboldo\nFazer infusao em 5 litro de agua quente \n\ntomar 6/18 hora\n\n3- Composto antiviral.\nAdicionar 6 gotas em meio copo de água, tomar 2 vezes ao dia, 9/21h.\n','2024-07-01','2024-07-01 12:07:37',1,1),(1834,644,'2-Composto de chás\n\nburututu\nimbondeiro\nalecrim\nquebra pedra\n\nferver em 5 litros de agua durante 20 min \ntomar 6/18 hora','2024-07-01','2024-07-01 12:07:33',1,1),(1835,644,'1- Chá composto de:\nMakakata.\nFilanganga em pó.\nFerver em 4,5 litros de água, tomar 1 xícara 2 vezes ao dia, 6/18h.\n\n2- Chá hepático.\nTomar 1 xícara 2 vezes ao dia, 6:30/18:30min.\n\n3- Chá batata africana.\nTomar 1 xícara 2 vezes ao dia, 7/19h.','2024-07-01','2024-07-01 12:07:17',1,1),(1836,1056,'1.\npulgante e comer m