.\nTribulo terrestris.\nUnha-de-gato.\nSemente cola.\nFerver em 6 litros de água, tomar 1 xícara 2 vezes ao dia, 6/18h.\n\n2- Composto antiviral (frasco de gota).\nAdicionar 9 gotas em meio copo de água natural, tomar 1 copo 2 vezes ao dia, 9/21h.\n\n3- Chá composto antiviral.\nTomar 1 xícara 2 vezes ao dia, 7/19h.\n\n4- Banhos-de-assento com folhas de goiaba, fazer 1 vez ao dia, 5:00h.\n\n5- Chá de losna. \nTomar 1 xícara 2 vezes ao dia, 6:30/18:30min.\n\n6- Chá pé de leão.\nTomar 1 xícara 2 vezes ao dia, 7:30/19:30min.','2024-07-29','2024-07-29 14:07:08',1,1),(2012,771,'1-Composto de chás\n\nTetrapleura\nUnha-de-Gato\nUxi-Amarelo\n\nferver em 5 litros de agua durante 20 min. E passar tomar 6h e 18horas.\n\n','2024-07-30','2024-07-30 08:07:34',1,1),(2013,563,'CARDÁPIO PARA UM DIA DE LIMPEZA INTESTINAL\n\nSuco intestino calmo (Primeira refeição) às 7:00h.\n\n1 xícara e meia de mamão sem sementes.\n2 maçãs vermelhas sem casca e sem sementes.\n2 xícaras de água de coco.\n8 colheres de sopa do gel de aloe vera.\nBater tudo no liquidificador, e tomar.\n\nSuco fibra em alta (segunda refeição) às 10:00h.\n\n4 ameixas grandes.\n4 tâmaras sem caroço.\n1 banana média.\n2 colheres de sementes de linhaça moídas.\n2 colheres de sopa de farelo trigo.\n1 copo de suco puro de laranja.\nDeixar as sementes de linhaça de molho em uma xícara de água durante três horas.\nColocar as sementes de linhaça com a água no liquidificador e triturá-las até que formem uma pasta homogênea.\nAdicionar as ameixas, as tâmaras, a banana e o farelo de trigo e bater no liquidificador até formar uma pasta homogênea.\nAdicionar o suco de laranja e misturar bem, e tomar.\n\n\n\n\n\nSuco água de chia (terceira refeição) 13:00h.\n\n4 colheres de sopa de semente de chia.\n6 colheres de sopa do suco puro de limão.\n4 xícaras de água.\nColocar de molho as sementes de chia em um copo de água por 30 min.\nColocar essa água com as sementes no liquidificador e bater até se obter uma pasta.\nAdicionar o restante da água e o suco de limão, mexendo até que se misture bem e tomar.\n\nSuco barriga lisa (quarta refeição) 16:00h.\n\n2 xícaras de mamão sem casca, em pedaços.\nMeia xícara do suco puro de ananás.\nMeia xícara de chá de hibisco.\nColocar todos os ingredientes no liquidificador e bater até obter um líquido homogêneo, e tomar.\n\nSuco goiaba com linhaça (quinta refeição) às 19:00h.\n\n2 xícaras de goiaba descascada e picada ou 1 xícara de pera.\n1 colher de sopa de sementes de linhaça.\n1 xícara do leite de soja.\nDescascar e picar a goiaba.\nBater a goiaba e as sementes de linhaça no liquidificador.\nCoar o líquido obtido. Acrescentar o leite de soja e mexer bem, e tomar.\n\n\n','2024-07-30','2024-07-30 09:07:51',1,1),(2014,563,'1- Chá de losna.\nTomar 1 xícara 2 vezes ao dia, 6/18h.\n\n2- Chá paco.\nAdicionar 1 colher de café em 1 copo de água natural misturar bem e tomar 1 copo 2 vezes ao dia, 7/19h.','2024-07-30','2024-07-30 10:07:10',1,1),(2015,955,'1. Boldo \n2. Paco\n3. Alecrim \n4. Chá antiviral','2024-07-30','2024-07-30 13:07:51',1,1),(2016,773,'1-Composto de chás\n\n10 mandamentos\nraiz de maboque\nDondo\n\nFerver em 5  litros  durante 20 min\n\ntomar 6/18 hora  ','2024-07-30','2024-07-30 19:07:44',1,1),(2017,983,'1- Composto antiviral (frasco de gota).\nAdicionar 7 gotas em meio copo de água natural, tomar 1 copo 2 vezes ao dia, 9/21h.\n\n2- Chá batata africana.\nTomar 1 xícara 2 vezes ao dia, 6/18h.\n\n3- Chá composto antiviral.\nTomar 1 xícara 2 vezes ao dia, 6:30/18:30min.\n\n4- Chá composto de:\nCamomila.\nFolha de loro.\nAlface.\nFerver 4,5 litros de água a parte, adicionar as folhas na água quente, tomar 1 vez ao dia, 21h.','2024-07-31','2024-07-31 12:07:38',1,1),(2018,1129,'1.\nPulgante e comer metade de mamao\n\n2. \nComposto de chás\n* 10 mandamentos \n* \n* Filanganga\n\nferver em 5 litros de água a temperatura mínima e conservar na geleira (aquecer antes de tomar)\ntomar uma xavena as 6/h18h\n\n3.\ncomposto para Hepatite B\nUma colher para uma chavena de água ferver 10 min.\ntomar 7/19h\n','2024-07-31','2024-07-31 13:07:40',1,1),(2019,1133,'1- Desintoxicação intestinal com o pulgante.\nComer com metade de mamão.\n\n2- Chá composto antiviral.\nTomar 1 xícara 2 vezes ao dia, 6/18h.\n\n3- Chá batata africana.\nTomar 1 xícara 2 vezes ao dia, 6/18h.\n\n4- Suco antiviral.\n2 xícaras de coco ralado (160g)\n4 xícaras ou 1 litro de água quente.\n1 colher de chá de canela em pó.\n1 colher de chá de casca de limão ralado.\nColocar o coco, a canela e a casca do limão no liquidificador e a medida que for batendo derramar sobre tudo isso água quente até que se forme uma pasta homogenea. Ainda quente, passar essa pasta de coco por coador, pressionando-a. tomar 1 vez ao dia antes das 18h. \n\n\n\n\n','2024-07-31','2024-07-31 14:07:24',1,1),(2020,962,'1-Composto de chás\nburututu\nimbondeiro\nraiz de maboque\n\nFerver em 5 litros de água durante 20 min\nTomar 6/18 Hora\n','2024-08-01','2024-08-01 07:08:53',1,1),(2021,1121,'1- Desintoxicação \nPulgante e comer  metade de mamão\n \n2.\nCompostos de chás\n* Macacata\n* Embondeiro\n* Mbondeiro\nFerver em 5 litros de água durante 15 min. e conservar na geleira\ntomar as 6h e as 18h\n\n3.\nComposto antiviral (3 saquetas)\n7/c as 19h \numa colher de chá para uma chávena de água fazer infusão\n','2024-08-01','2024-08-01 10:08:29',1,1),(2022,787,'1-Composto de chás\n\naçafrão\n10 mandamentos\nRaiz de maboque\n\n\nferver em 5 litros de agua durante 20 min\ntomar 6/18 hor','2024-08-02','2024-08-02 08:08:51',1,1),(2023,1077,'\n1-Composto de Chas\ncamomila\nlosna\nalecrim\nantiviral\n\n\nferver em 5 litros de agua durante 20 min\n \ntomar 6/18 hora\n','2024-08-02','2024-08-02 11:08:48',1,1),(2024,622,'1-Composto de chás\nalecrim\nlosna \ncamomila \n\nFazer infusão em 5 litros de agua quente\n\ntomar 6/18 hora','2024-08-04','2024-08-04 08:08:15',1,1),(2025,568,'1-vaporizacao\ndurante 80min\n\n2-Composto de antiviral\nalecrim\nlosna\ncamomila\ncipolmil homem\n\n\nfazer infusão em 5 litro de 