ionar o suco de limão e mexer.\n\n                                                                    Quarta refeição (16:00h) Infusão de hibisco.\n\nFerver 1 xícara de água aparte e adicionar 1 colher de chá das folhas de hibisco.\n\n                                                                       \n\n                                                                          Quinta refeição (19:00h) Água de chia\n\n4 colheres de sopa de semente de chia.\n6 colheres de sopa de suco de limão.\n4 xícara de água.\nColocar de molho as sementes de chia em um copo de água por 30min.\nColocar essa água com sementes no liquidificador e bater até se tornar uma pasta.\nAdicionar o restante da água e o suco de limão, mexendo até que se misture bem. \n','2024-08-04','2024-08-04 15:08:34',1,1),(2032,1095,'1- Chá composto de:\nUxi-amarelo.\nUnha-de-gato.\nTribulo terrestre.\nCanela.\nSemente cola.\nFerver em 6 litros de água, tomar 1 xícara 2 vezes ao dia, 6/18h.\n\n2- Chá de amenorreia.\nTomar 1 xícara 2 vezes ao dia, 6:30/18:30min.\n\n3- Suco fertilidade em alta.\nMeia xícara de abacate.\n6 castanhas de caju.\nUma xícara e meia do suco puro de laranja.\n2 colheres de sopa de germém de trigo.\n2 colheres de sopa do suco de limão.\nBater tudo no liquidificador, tomar 1 vez ao dia, antes das 18h.\n\n4- Chá de mioma.\nTomar 1 xícara 2 vezes ao dia, 7/19h.','2024-08-05','2024-08-05 09:08:20',1,1),(2033,1026,'1-Composto de chás\nuxi amarelo\nunha de gato\nraiz maboque \nDondo\n\n\nferver em 5 litros de agua durante 20 min\n\ntomar 6/18 hora\n','2024-08-05','2024-08-05 11:08:40',1,1),(2034,1049,'2-Composto de chás\nDondo\ncipol mil homem\nPé de leão \n\nFerver em 5 litros de água quente durante 20 min\n\ntomar 6/18 hora','2024-08-05','2024-08-05 12:08:43',1,1),(2035,1142,'1-Pulgante\ncomer metade de mamão\n\n2-Composto de chás\nalecrim\nBoldo\ncamomila\n\nfazer infusão em 5litro de agua \n\ntomar 6/18 hora','2024-08-06','2024-08-06 09:08:28',1,1),(2036,1146,'1-Pulgante\ncomer met