ras, a banana e o farelo de trigo e bater no liquidificador até formar uma pasta homogênea.\nAdicionar o suco de laranja e misturar bem, e tomar.\n\n\n\n\n\nSuco água de chia (terceira refeição) 13:00h.\n\n4 colheres de sopa de semente de chia.\n6 colheres de sopa do suco puro de limão.\n4 xícaras de água.\nColocar de molho as sementes de chia em um copo de água por 30 min.\nColocar essa água com as sementes no liquidificador e bater até se obter uma pasta.\nAdicionar o restante da água e o suco de limão, mexendo até que se misture bem e tomar.\n\nSuco barriga lisa (quarta refeição) 16:00h.\n\n2 xícaras de mamão sem casca, em pedaços.\nMeia xícara do suco puro de ananás.\nMeia xícara de chá de hibisco.\nColocar todos os ingredientes no liquidificador e bater até obter um líquido homogêneo, e tomar.\n\nSuco goiaba com linhaça (quinta refeição) às 19:00h.\n\n2 xícaras de goiaba descascada e picada ou 1 xícara de pera.\n1 colher de sopa de sementes de linhaça.\n1 xícara do leite de soja.\nDescascar e picar a goiaba.\nBater a goiaba e as sementes de linhaça no liquidificador.\nCoar o líquido obtido. Acrescentar o leite de soja e mexer bem, e tomar.\n\n\n','2024-09-27','2024-09-27 12:09:45',1,1),(2289,622,'1-Aloina \n\n1 colher tomar 9/21 hora\n\n2-Alecrim e boldo\n\nfazer infusão em 4 litros de agua durante quente \n\ntomar 6/18 hora ','2024-09-29','2024-09-29 08:09:06',1,1),(2290,1192,'2 Composto de chás\nTetrapleura\namenorreia\nuxi amarelo\npimenta africana\n\nferver em 5 litro de agua durante 20 min\n\ntomar 6/18 hora','2024-09-29','2024-09-29 08:09:46',1,1),(2291,1180,'\n2-Composto de chás\nTetrapleura\ndondo\ncomposto mioma\nuxi amarelo\n\nferver em 5 litro de agua durante 20 min\n\ntomar 6/18 hora\n\n','2024-09-29','2024-09-29 09:09:08',1,1),(2292,473,'1- Composto antiviral.\nAdicionar 6 gotas em um pouquinho de água natural, tomar 1 copo 2 vezes ao dia, 9/21h.\n\n2- Chá composto antiviral.\nTomar 1 xícara 2 vezes ao dia, 6/18h.\n\n3- Chá batata africana.\nTomar 