n1 xícara e meia de uvas pretas ou vermelhas.\nBater tudo no liquidificador sem adicionar nada.\n\n                                                              Terceira refeição (13:00h) Suco limpador hepático\n\n1 xícara de repolho roxo.\n3 cenouras.\n1 maçã vermelha com casca.\n2 colheres de sopa do suco de limão.\nDepois de lavados, passar o repolho, as cenouras e a maçã a vapor ou uma pequena fervura e só depois adicionar o suco de limão e mexer.\n\n                                                                    Quarta refeição (16:00h) Infusão de hibisco.\n\nFerver 1 xícara de água aparte e adicionar 1 colher de chá das folhas de hibisco.\n\n                                                                       \n\n                                                                          Quinta refeição (19:00h) Água de chia\n\n4 colheres de sopa de semente de chia.\n6 colheres de sopa de suco de limão.\n4 xícara de água.\nColocar de molho as sementes de chia em um copo de água por 30min.\nColocar essa água com sementes no liquidificador e bater até se tornar uma pasta.\nAdicionar o restante da água e o suco de limão, mexendo até que se misture bem. \n','2024-11-12','2024-11-12 14:11:48',1,1),(2458,1028,'CARDÁPIO PARA UM DIA DE LIMPEZA HEPÁTICA\n\n                                                       Pequeno-almoço (7:00h) Suco limonada antinflamatório\n\n1 xicara de suco de limão espremido, de 4 a 6 limões.\n3 xícaras de água.\n1 colher de chá de curcuma ou açafrão em pó.\n1 colher de chá de canela em pó.\nBater tudo no liquidificador e tomar.\n\n                                                              Segunda refeição (10:00h) Suco integral de uvas\n\n1 xícara e meia de uvas pretas ou vermelhas.\nBater tudo no liquidificador sem adicionar nada.\n\n                                                              Terceira refeição (13:00h) Suco limpador hepático\n\n1 xícara de repolho roxo.\n3 cenouras.\n1 maçã vermelha com casca.\n2 colheres de sopa do suco de limão.\nDepois de lavados, passar o repolho, as cenouras e a maçã a vapor ou uma pequena fervura e só depois adicionar o suco de limão e mexer.\n\n                                                                    Quarta refeição (16:00h) Infusão de hibisco.\n\nFerver 1 xícara de água aparte e adicionar 1 colher de chá das folhas de hibisco.\n\n                                                                       \n\n                                                                          Quinta refeição (19:00h) Água de chia\n\n4 colheres de sopa de semente de chia.\n6 colheres de sopa de suco de limão.\n4 xícara de água.\nColocar de molho as sementes de chia em um copo de água por 30min.\nColocar essa água com sementes no liquidificador e bater até se tornar uma pasta.\nAdicionar o restante da água e o suco de limão, mexendo até que se misture bem. \n','2024-11-12','2024-11-12 14:11:03',1,1),(2459,1028,'1- Chá composto de:\nHibisco.\nBoldo.\nLosna.\nAlecrim.\nFerver 5 litros de água a parte tomar, 1 xícara 2 vezes ao dia, 6/18h.\n\n2- Suco puro de cebola.\nMeia cebola média, para 200ml de água, tomar 1 copo 2 vezes ao dia, após as refeições.\n\n3- Cataplasma de cebola, mel e farinha de mandioca.\nFazer em fogo brando e aplicar na reigião afetada, e deixar agir por 3h.\n\n4- Chá de batata africana.\nTomar 1 xícara 2 vezes ao dia, 6:30/18:30min.\n\n5- Composto antiviral.\nAdicionar 8 gotas em um pouquinho de água natural, tomar 1 copo 2 vezes ao dia, 9/21h.\n\n6- Suco puro de beringela.\n1 beringela.\n250ml de água.\n1 limão.\nBater no liquidificador a beringela o suco puro do limão e adicionar os 250ml de água e tomar 1 vez ao dia em jejum.','2024-11-12','2024-11-12 14:11:38',1,1),(2460,1283,'1-Pulgante\ncomer metade de mamão\n\n2-Composto de chás\nuxi amarela\nunha de  gato\npimenta africana\n\nferver em 5 litro de agua durante 20 min\n\ntomar 6/18 hora\n\n3-Banho de assento\n','2024-11-17','2024-11-17 09:11:03',1,1),(2461,1191,'1-Composto de chás\n\n\nraiz de maboque\n10 mandamentos\nunha de gato\nuxi amarelo\nferver em 5 litro de agua durante 20 min \n\ntomar 1 chávena de 200 ml 6/18 hora','2024-11-17','2024-11-17 09:11:13',1,1),(2462,1071,'1-Composto de chás\nbatata africana\nraiz de maboque\nburututu\n10 mandamento\n\nferver em 5 litros de agua durante 20 min, temperatura min\n\n\ntomar 6/18 hora','2024-11-17','2024-11-17 09:11:32',1,1),(2463,1213,'1-Composto de chás\nuxi amarelo\nunha de gato\nraiz de maboque\nPimenta africana\n\nferver.em 5 litros de agua  durante 20  minutos temperatura minima\n\ntomar 6 e 18  hora','2024-11-17','2024-11-17 10:11:49',1,1),(2464,875,'1-composto de chás\ncamomila\nchapeu de couro\n\n\nfazer infusao em 4 litro de agua quente \n\ntomar 6/18 Hora\n\n2-Banho de assento durante 15 min','2024-11-17','2024-11-17 10:11:17',1,1),(2465,1192,'1-Composto de alecrim- fazer infusão \npé de leão\n chá milagroso\n\n\n\n2-Vinagre de maca 2 colheres adicionar em \n1 chávena de composto de amenorreia\n\ntomar 45 min após a refeição','2024-11-17','2024-11-17 11:11:06',1,1),(2466,1307,'1-Pulgante\ncomer metade de mamão\n\n2-Composto de chás\ncha de hepatite\nraiz de maboque \nburututu\npaco\n\nferver em 5 litro de agua durante 20 min\n\ntomar 63/18 hora\n','2024-11-17','2024-11-17 11:11:53',1,1),(2467,913,'2-Composto de chás\ncha milagroso\ncomposto de hepatite\nburututu\n\nferver em 5 litros  de durante  20 min\ntomar 6/18  hora','2024-11-18','2024-11-18 11:11:30',1,1),(2468,949,'1- composto de chás\nVinagre de maca\nUxi amarelo\nTetra pleura\nBatata Africana\n\nFerver em 5 litros de agua durante 15/20m e tomar as 6h/18\n\nFazer os clister com filangangqa','2024-11-19','2024-11-19 08:11:22',1,1),(2469,568,'1- Chá composto de:\nUxi-amarelo.\nUnha-de-gato.\nBatata africana.\nPé-de-leão.\nFerver 6 litros de água, tomar 1 xícara 2 vezes ao dia, 6/18h.','2024-11-19','2024-11-19 08:11:43',1,1),(2470,1161,'\n12-Composto de chás\nbatata africana\nunha de gato\nuxi amarelo\ndondo\n\nferver em 5 litro de