INSERT INTO `relactoriomedico` VALUES (1,2,'2023-02-20 06:02:18','<p>JKJLK</p>\r\n'),(2,712,'2024-01-17 10:01:43','<p><strong>Pedro Andr&eacute; Gon&ccedil;&aacute;lves Mateus</strong>, de sexo masculino e de 30 anos de idade, foi recebido no dia 22 de Agosto de 2023 com as seguintes queixas: tosses, dores do peito e de coluna, falta de apetite e febre, por este motivo foi submetido a exames cl&iacute;nicos e de imagem tendo por conclus&atilde;o diagn&oacute;stica problemas respirat&oacute;rio.</p>\r\n\r\n<p>Entretanto a equipe assistente optou por tratamento ambulat&oacute;rio (feito em casa) e um repouso p&oacute;s-tratamento. evoluiu durante o tratamento em ambas as fases, sem intercorr&ecirc;ncias cl&iacute;nicas, e actualmente segue com quadro cl&iacute;nico est&aacute;vel podendo dar o seguimento das suas actividades laborais e vida normal.&nbsp;</p>\r\n'),(3,712,'2024-01-17 10:01:43','<p><strong>Pedro Andr&eacute; Gon&ccedil;&aacute;lves Mateus</strong>, de sexo masculino e de 30 anos de idade, foi recebido no dia 22 de Agosto de 2023 com as seguintes queixas: tosses, dores do peito e de coluna, falta de apetite e febre, por este motivo foi submetido a exames cl&iacute;nicos e de imagem tendo por conclus&atilde;o diagn&oacute;stica problemas respirat&oacute;rio.</p>\r\n\r\n<p>Entretanto a equipe assistente optou por tratamento ambulat&oacute;rio (feito em casa) e um repouso p&oacute;s-tratamento. evoluiu durante o tratamento em ambas as fases, sem intercorr&ecirc;ncias cl&iacute;nicas, e actualmente segue com quadro cl&iacute;nico est&aacute;vel podendo dar o seguimento das suas actividades laborais e vida normal.&nbsp;</p>\r\n');
