INSERT INTO `site` VALUES ('614355f5a5b99.png',' +244 923 066 230','','geral@clinicadaisywell.com','Segunda - Domingo  ','08:00 - 17:00','https://www.facebook.com/clinicadaisywell','https://www.instagram.com/clinicadaisywell/','63a18ce8c192b.jpg','O novo conceito de medicina reprodutiva','634d1768dacd7.png','A sua saúde nosso maior objectivo.','634d1768dd516.jpg','Onde o seu futuro começa. ','Manter a Fé ','\"Às vezes, perdemos a fé e a esperança por conta das dificuldades e limitações que todos os casais tentantes passam. Mas é importante falarmos sobre a fé. Não desista de tentar, pois em breve você terá um lindo bebê em seu ventre.\" ','Laurindo Tchilima','Especialista em Saúde Reprodutiva','SERVIÇOS','SERVIÇOS','Consulta de Especialidade Reprodutiva','O Doutor recebe o casal e, através de uma entrevista exaustiva sobre historial clínico (patologias, cirurgias), hábitos de vida (stress, alimentação, medicação) e actividade sexual, bem como a análise de exames médicos prévios, traça o historial de ambos os elementos. Esta etapa é importante, uma vez que detectar situações, algumas até de resolução simples, que podem estar a comprometer a fertilidade.','Inseminação Artificial','A inseminação artificial, também conhecida como inseminação intra-uterina (IIU), é uma técnica de reprodução assistida em que o sémen é depositado directamente na cavidade uterina da mulher durante o período fértil, aumentando assim as chances de conceber uma gravidez, especialmente em casos de infertilidade.','Inseminação in Vitro','Na fertilização in vitro a produção ovariana da mulher é estimulada para que haja mais óvulos em comparação à produção natural. Em seguida, os óvulos são captados através de uma punção guiada por um ultrassom transvaginal e fertilizados pelos espermatozoides em laboratório.','Transferência de embriões','A transferência embrionária ocorre com a utilização de um tubo fino e flexível (cateter) dentro do útero por meio do orifício externo do colo uterino. Uma seringa com um ou mais embriões em suspensão no fluido estará ligada à extremidade do cateter para que o fluido seja empurrado para dentro do útero através do tubo. ','Exame','Todos os exames necessarios para o procedimento de Inseminacao Artificial ou Inseminação in VITRO',1,'Agendar Consulta','Ver Exame','634d1768ddeb9.png','634d1768e123d.png','634d1768e2436.png','634d1768e4dfd.png','634d1768e8ad6.png','61630ecf05d77.png');
/*!40000 ALTER TABLE `site` ENABLE KEYS */;
